import { Navbar,NavbarBrand } from "reactstrap";
const Nav =()=>{
    return(
        <Navbar color="#17a2b8" expand="xl" light>
        <NavbarBrand href="/">
          <h1>nearby Therapist</h1>
          <span>Find Your Top Local Therapists</span>
        </NavbarBrand>
      </Navbar>
    )
}
export default Nav;
